Writing Tests for PHPUnit
writing-tests-for-phpunit.examples.StackTest.php shows how we can
write tests using PHPUnit that exercise PHP's array operations. The
example introduces the basic conventions and steps for writing tests
with PHPUnit:
#.

The tests for a class Class go into a class ClassTest.

#.

ClassTest inherits (most of the time) from
PHPUnit\Framework\TestCase.

#.

The tests are public methods that are named test*.
Alternatively, you can use the @test annotation in a method's
docblock to mark it as a test method.

#.

Inside the test methods, assertion methods such as assertSame() (see
appendixes.assertions) are used to assert that an actual value
matches an expected value.

assertSame(0, count($stack));

        array_push($stack, 'foo');
        $this->assertSame('foo', $stack[count($stack)-1]);
        $this->assertSame(1, count($stack));

        $this->assertSame('foo', array_pop($stack));
        $this->assertSame(0, count($stack));
    }
}

Martin Fowler:
Whenever you are tempted to type something into a print statement or
a debugger expression, write it as a test instead.

Test Dependencies

Adrian Kuhn et. al.:
Unit Tests are primarily written as a good practice to help developers
identify and fix bugs, to refactor code and to serve as documentation
for a unit of software under test. To achieve these benefits, unit
tests ideally should cover all the possible paths in a program. One
unit test usually covers one specific path in one function or method.
However a test method is not necessarily an encapsulated, independent
entity. Often there are implicit dependencies between test methods,
hidden in the implementation scenario of a test.

PHPUnit supports the declaration of explicit dependencies between test
methods. Such dependencies do not define the order in which the test
methods are to be executed but they allow the returning of an instance
of the test fixture by a producer and passing it to the dependent
consumers.

A producer is a test method that yields its unit under test as

return value.


A consumer is a test method that depends on one or more producers

and their return values.



writing-tests-for-phpunit.examples.StackTest2.php shows how to use the
@depends annotation to express dependencies between test methods.
assertEmpty($stack);

        return $stack;
    }

    /**
     * @depends testEmpty
     */
    public function testPush(array $stack): array
    {
        array_push($stack, 'foo');
        $this->assertSame('foo', $stack[count($stack)-1]);
        $this->assertNotEmpty($stack);

        return $stack;
    }

    /**
     * @depends testPush
     */
    public function testPop(array $stack): void
    {
        $this->assertSame('foo', array_pop($stack));
        $this->assertEmpty($stack);
    }
}
In the example above, the first test, testEmpty(), creates a new array
and asserts that it is empty. The test then returns the fixture as its
result. The second test, testPush(), depends on testEmpty() and is
passed the result of that depended-upon test as its argument. Finally,
testPop() depends upon testPush().
Note
The return value yielded by a producer is passed "as-is" to its
consumers by default. This means that when a producer returns an object,
a reference to that object is passed to the consumers. Instead of a
reference either (a) a (deep) copy via @depends clone, or (b) a
(normal shallow) clone (based on PHP keyword clone) via
@depends shallowClone are possible too.
To localize defects, we want our attention to be focussed on relevant
failing tests. This is why PHPUnit skips the execution of a test when a
depended-upon test has failed. This improves defect localization by
exploiting the dependencies between tests as shown in
